import { useState } from 'react';


export default function MyApp(){
  <div>
      <h1>
    Event usestate count
    </h1>
  <MyButton/>
  <MyButton/>
    </div>
}


function MyButton() {
  const [count , setcount] = useState(0);

function eventHandler(){
  setcount(count + 1);
}
return(
   <button onClick={eventHandler}>
    Check {count} time
   </button>
  );
}
